import React from 'react';






function Skills() {
  const skillGroups = [
    {
      group: 'Programming Languages',
      items: [
        { name: 'Python',  color: 'blue' },
        { name: 'SQL (PostgreSQL, MySQL)',  color: 'orange' },
        { name: 'Python Libraries (numpy, pandas, scikit-learn, streamlit, matplotlib, Pytorch, Seaborn, ONNX, Sqlalchemy)',  color: 'green' },
        { name: 'Javascript', color: 'yellow' },
        { name: 'HTML',  color: 'red' },
        { name: 'CSS', color: 'teal' },
      ],
    },
    {
      group: 'Machine Learning (ML)',
      items: [
        { name: 'Linear and Logistic Regression',  color: 'blue' },
        { name: 'Random Forests',  color: 'green' },
        { name: 'PCA',  color: 'orange' },
        { name: 'Gradient Boosting',  color: 'purple' },
        { name: 'K-means',  color: 'teal' },
        { name: 'Deep Learning',  color: 'red' },
        { name: 'NLP (nltk, SpaCy, Word2Vec, GloVe, TF-IDF)',  color: 'blue' },
        { name: 'Time Series Forecasting (Facebook Prophet, SARIMA models)',  color: 'green' },
        { name: 'PyTorch',  color: 'orange' },
        { name: 'TensorFlow 2.0',  color: 'purple' },
        { name: 'HuggingFace',  color: 'teal' },
        { name: 'PyCaret',  color: 'red' },
      ],
    },
    {
      group: 'Data',
      items: [
        { name: 'Data Visualization (Tableau, AWS QuickSight, Vizro, Atoti)',  color: 'blue' },
        { name: 'Processing Large Data Sets',  color: 'orange' },
        { name: 'A/B testing',  color: 'purple' },
        { name: 'Experimentation', color: 'teal' },
        { name: 'Distributed Computing (PySpark)',  color: 'green' },
        { name: 'Product Analytics',  color: 'red' },
      ],
    },
    {
      group: 'Cloud Computing',
      items: [
        'Amazon Web Services (AWS)',
        'EMR, EC2, S3', 
        'SageMaker, AWS Glue, BigQuery',
        'Docker, Docker Compose, Git', 
        'Model Orchestration (Mage AI)',  
      ],
    },
  ];


  return (
    <div className='skills'>
      <h3>SKILLS</h3>
      {skillGroups.map((group, groupIndex) => (
        <div key={groupIndex}>
          <div className='skill-group'>
            <span className='skills-group'>{group.group}:</span>
            <span>{group.items.join(', ')}</span>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Skills;
